import React from 'react';
import "./Post.css";
import tree from "../../Assets/tree.jpg";
import like from "../../Assets/like.jpg";
import heart from "../../Assets/heart.jpg";
import {MoreVert} from "@material-ui/icons";

export default function Post(post) {
    console.log(post);
    console.log (post.date);
  return (
    <div className="Post">
        <div className="Postwrapper">
            <div className="Posttop">
                <div className="posttopleft">
                    <img className="profileimg" src={tree} alt="tree" />
                    <span className="username">Ali</span>
                    <span className="time">{post.date}</span>
                    


                </div>
                
                <div className="posttopright">
                    <MoreVert/>

                </div>

            </div>
            <div className="Postcenter">
                <span className="posttext">{post.desc}</span>
                <img className="postimg" src={post.photo} alt="tree" />
            </div>

            <div className="Postbottom">
                <div className="postbottomleft">
                    <img src={heart} alt="" className="likeicon" />
                    <img src={like} alt="" className="likeicon" />
                    <span className="postlikecounter">{post.like} people liked it</span>
                </div>
                <div className="postbottomright">
                    <span className="postcommenttext">{post.comment} comments</span>
                </div>
            </div>

        </div>
    </div>
  )
}
